/* eslint-disable import/no-anonymous-default-export */

import Carroussel from "../Carroussel";
import Ft from "../Ft";


export default() => { 
    return(<>
        <div className="Carroussel-item active"> 
        <Carroussel Foto=".img/pousadaBonito.jpg" class="d-block w-100" alt="1325x400" width="1330" height="400"></Carroussel>
          </div>

    

    <figure className="img01">
    <Ft Foto="caribeHolandes.jpg"></Ft>
    <figcaption>Caribe Holandes (Aruba) - Promoção do Dia</figcaption>
</figure>
<figure className="img02">
    <Ft src="Bariloche.jpg"></Ft>
    <figcaption>Bariloche (Argentina) - Promoção do Dia</figcaption>
</figure>
<figure className="img03">
    <Ft src="Madri.jpg"></Ft>
    <figcaption>Madri (Espanha) - Promoção do Dia</figcaption>
</figure>
</>

    );
}
